        <a href="">
          <div>
            
          </div>
          <img className="img-estabelecimento" src={props.url_img} alt="" />
          <br />
          <b>{props.nome}</b>
          <br />
          <i className="fa-solid fa-star"></i>
          <p>{props.avaliacao} - Lanches</p>
          <br />
          <br />
        </a>
      </div>
    </>
  );
}

export default Estabelecimento;
